			"TBAppDescription": "** Winner of Apple\u2019s Editor\u2019s Choice award on the Mac and featured by The New York Times, Good Morning America, CNN, Wired, & more! **\n\nAccurate and Detailed\nDark Sky\u2019s super accurate weather data gives you quick access to your current, hourly, and daily forecasts. Or just tap anywhere for more meteorological goodness.\n\nOverflowing with Personality\nFrom spooky fog to torrential downpours, CARROT\u2019s dialogue, characters, and scenery change in\u2026 \u201cunexpected\u201d ways. You\u2019ll actually be looking forward to a blizzard just to see what CARROT has in store for you!\n\nNotifications\nPremium Club users can sign up for severe weather alert and daily summary notifications, and Apple Watch users can also receive warnings about incoming precipitation. (Severe weather alerts are only available in the US. Daily reports work worldwide. Precipitation notifications are available in the US, UK, and parts of Canada.)\n\nWeather Maps\nWatch in awe as the next big storm bears down on your house with CARROT\u2019s trusty radar (for the US, UK, Canada, Australia, France, and Germany) and satellite (for the rest of the world) maps. Plus, Ultrapremium Club users get access to future radar, lightning strikes, and 12 additional map layers!\n\nCustomization\nWant to disable CARROT's personality? You can turn her into a 100% professional weather app! And Premium Club members can customize every last data point that CARROT displays to show the weather data that you care about.\n\nTime Machine\nView the weather for any location up to 70 years in the past. DeLorean not required!\n\nSiri Shortcuts\nAsk Siri about upcoming weather or use forecast data to build complex workflows in the Shortcuts app.\n\nSecret Locations\nFollow clues to hunt down 44 secret locations - like the Moon, the Pyramids, and Chernobyl.\n\nAchievements\nUnlock 34 achievements by experiencing weather events, traveling around the world, and using different features in the app.\n\nApple Watch\nIn addition to a full weather app and notifications, you also get colorful complications for your watch face. (Note: Premium Club subscription required to unlock background data updates, notifications, and complication customization features.)\n\nFeatures:\n\u2022 Beautifully minimalist weather app\n\u2022 Dark Sky\u2019s super accurate weather data\n\u2022 Weather Underground data source available as an upgrade\n\u2022 Severe weather alert and daily summary notifications\n\u2022 Precipitation notifications via CARROT Weather for Apple Watch\n\u2022 Radar and satellite maps\n\u2022 Apple Watch app with complications\n\u2022 Siri shortcuts\n\u2022 Today widget\n\u2022 6,000+ lines of hilarious spoken dialogue\n\u2022 44 secret locations\n\u2022 34 achievements\n\u2022 24 alternative app icons\n\nDon\u2019t make CARROT angry. Download her now!\n\n---\n\nCARROT Weather uses auto-renewing subscriptions. The Premium Club subscription provides additional features like notifications, customization, an alternative weather data source, and Apple Watch background updates. The Ultrapremium Club subscription provides all the features of Premium Club, plus additional weather map layers and alternative data source access for Apple Watch users. The subscription will be charged to your iTunes account at confirmation of purchase. Subscriptions will automatically renew at the end of your subscription period and will be charged through your iTunes account. Subscriptions renew automatically unless canceled at least 24 hours prior to the end of the current period. Your account will be charged for renewal within 24 hours prior to the end of the current period. You can turn off auto-renewal at any time from your iTunes account settings. Cancellation of the current active subscription period is not allowed.\n\nTerms of Use: http:\/\/support.meetcarrot.com\/weather\/terms.html\nPrivacy Policy: http:\/\/support.meetcarrot.com\/weather\/privacypolicy.html",
