			"TBAppDescription": "If you want to improve your English grammar greatly, this application is for you. Doing these tests with explanations, you can improve your grammar from Basic to Advanced - free.\n\nYou will not see only tests. You will also see explanations for each test. It will help you to understand your weak points and improve your knowledge greatly. It's for all levels - Beginner, Elementary, Pre-Intermediate, Intermediate, Upper-Intermediate, Advanced. You will learn English grammar step by step (from simple topics to more difficult ones).\n\nIt\u2019s a full English grammar course (the most complete version with all English grammar aspects you need to know). There are 10 tests in each topic with explanations and 15 in the last topic.\n\nYou will be doing tests and studying at the same time (with the help of the explanations). It\u2019s a very intensive and effective English grammar practice. It\u2019s perfect for self-study. For more practice, you can do these tests as many times as you need (the tasks will be in a new order again and again). There are also big tests (mixed tests) on different subjects which help you to memorize and practice everything more effectively to get the maximum result.\n\nThe structure of the application is the following:\n\nBeginner - Pre-Intermediate\nPresent Simple 1-16\nPast Simple 17-38\nFuture Simple 39-42\nPresent Continuous 43-57\nBasic Structures 1 58-73\nModal Verbs 74-91\nPassive Voice 92-107\nConditionals 108-120\nBasic Structures 2 121-143\nShort Answers 144-163\nBasic Structures 3 164-187\nAdverbs and Adjectives 188-206\nNumbers and Prepositions 207-221\nTag Questions 222-245\nInfinitive, Verb+ing 246-266\nArticles 267-281\nPhrasal Verbs and Indirect Questions 283-295\nBasic Structures 4 296-309\n\nIntermediate - Advanced\nEnglish Tenses and Passive Voice 310-362\nPassive Voice and Tenses Revision 363-384\nConditionals and Modal Verbs 385-398\nPrepositions 399-420\nReported Speech 421-451\nQuestions and Adjectives 452-468\nWord Formation 469-498\nPhrasal Verbs 499-518\nMore Advanced Structures 519-555",
